import React from 'react';
import Radium from 'radium';

const charComponent = ( props ) => {
    const style = {
        display: "inline-block",
        padding: "10px",
        textAlign: "center",
        border: "none",
        backgroundColor: "#232323",
        color: "#eee",
        borderRadius: "4px",
        cursor: "pointer"
    };

    return (
        <div style={style} onClick={props.click}>
            {props.letter}
        </div>
    );
};

export default Radium(charComponent);
